import logo from './logo.svg';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import {banner} from "./banner"
import {Contact} from "./Contact"
import {programs} from "./programs"


function App() {
  return (
    <>

      <Router>
        <Banner />

        <Switch>
          <Route exact path="/banner" src={banner} />
          <Route exact path="/programs" src={programs} />
          <Route exact path="/Contact" src={Contact} />
        </ Switch>

      </ Router>
    </>
  );
}

export default App;
